const MessageContainer = (messages)=>{

    const msgs = ["hi", "hello", "hey", "how are you?", "What are you doing?"]
    return <div>
            <table striped="true">
            {console.log(messages, typeof(messages))}
        {
            msgs.map((msg, index) =>{
                    <tr key={index}>
                        <td>{index} - {msg}</td>
                    </tr>
            })
        }
        </table>
    </div>
}

export default MessageContainer;
